import React, { Component } from 'react';
import email from '../images/email.png';
import github from '../images/github.png';
import instagram from '../images/instagram.png';
import linkedin from '../images/linkedin.png';
import twitter from '../images/twitter.png';

class Navbar extends Component {

  handleOnClick = (icon) => {
    console.log(icon)
  }

	render() {
	  return(
	    <div className ="navbar">
	 	  <img onClick={() => this.handleOnClick('email')} className= "inNavbar" src= {email}></img>
	  	  <img onClick={this.handleOnClick} className= "inNavbar" src= {github}></img>
	  	  <img onClick={this.handleOnClick} className= "inNavbar" src= {instagram}></img>
	  	  <img onClick={this.handleOnClick} className= "inNavbar" src= {linkedin}></img>
	  	  <img onClick={this.handleOnClick} className= "inNavbar" src= {twitter}></img>
	    </div>
	  )
	}
}
export default Navbar
